webpackJsonp([0x60636748749e],{4310:function(t,o){t.exports={data:{markdownRemark:{html:'<h2>Git Hooks</h2>\n<p>Git Hooks are scripts located in the <code>.git/hooks/</code> directory of a git repository. These scripts run after being triggered by different stages in the version control process.</p>\n<h3>Samples</h3>\n<p>In this directory are a handful of sample scripts, such as <code>pre-commit.sample</code>. This particular sample runs every time a user runs <code>git commit</code>. If the hook script exits with a status other than 0, then the commit stops.</p>\n<h3>Documentation</h3>\n<ul>\n<li><a href="https://git-scm.com/docs/githooks">Documentation for Git Hooks</a></li>\n<li><a href="https://www.atlassian.com/git/tutorials/git-hooks">Atlassian Tutorial on Git Hooks</a></li>\n<li><a href="http://githooks.com/">Git Hooks Guide</a></li>\n</ul>',fields:{slug:"/git/git-hooks/"},frontmatter:{title:"Git Hooks"}}},pathContext:{slug:"/git/git-hooks/"}}}});
